import { Tabs, Tab, Toolbar, Typography, Button } from '@mui/material';
import AppBar from '@mui/material/AppBar';
import './aaa.css';
 



export const Navbar = () => {
const buttonStyles={
    fontFamily: 'Manrope',

    color:'white'
}
 
    return (
        <>
            <AppBar 
            elevation={0} 
            style={{ background: 'radial-gradient(circle at 3% 25%, rgba(0, 40, 83, 1) 0%, rgba(4, 12, 24, 1) 25%)' }}
             >
                <Toolbar disableGutters sx={{ p: 3, ml: 5 }} >
                    <Tabs
                   >
                        <Tab >
                            <Typography>
                                Logo
                            </Typography>
                        </Tab>
                        <Tab label='HOME' disableRipple  sx={buttonStyles}/>
                        <Tab label='What is GPT?'disableRipple  sx={buttonStyles}/>
                        <Tab label='OPEN AI'  sx={buttonStyles}/>
                        <Tab label='CASE STUDIES'disableRipple  sx={buttonStyles}/>
                        <Tab label='Library'disableRipple  sx={buttonStyles}/>

                    </Tabs>
                    <Button 
                    size={'large'}
                    sx={{marginLeft:'auto',marginRight:'20px'}}
                    color='success'
                    disableElevation
                    variant='outlined'>
                        Sign In
                    </Button>
                    <Button
                    
                     size={'large'}
                    sx={{marginRight:'50px'}}
                    color='primary'
                    disableElevation
                    variant='contained'>
                        Sign Up
                    </Button>


                </Toolbar>

            </AppBar>
        </>
    )
}
